CREATE TABLE `company` (
   `id` INT AUTO_INCREMENT,
   `name` VARCHAR(100),
   `phone` VARCHAR(255),
   `cuit` VARCHAR(255),
   `email` VARCHAR(255),
   PRIMARY KEY (`id`)
);

CREATE TABLE `categories` (
   `id` INT AUTO_INCREMENT,
   `name` VARCHAR(255),
   PRIMARY KEY (`id`)
);

CREATE TABLE `flavors` (
   `id` INT AUTO_INCREMENT,
   `name` VARCHAR(255),
   PRIMARY KEY (`id`)
);

CREATE TABLE `users` (
   `id` INT AUTO_INCREMENT,
   `email` VARCHAR(255),
   `password` VARCHAR(255),
   `admin` TINYINT,
   PRIMARY KEY (`id`)
);

CREATE TABLE `products` (
   `id` INT AUTO_INCREMENT,
   `category_id` INT NOT NULL,
   `flavor_id` INT NOT NULL,
   `name` VARCHAR(255),
   `description` TEXT,
   `stock` INT DEFAULT 0,
   `price` FLOAT,
   `status` TINYINT DEFAULT 0,
   `img` VARCHAR(255) DEFAULT 'product-default.png',
   PRIMARY KEY (`id`)
);


ALTER TABLE `products` ADD CONSTRAINT `FK_6d7113d9-fe0e-4948-8290-0c2f270e7b3b` FOREIGN KEY (`category_id`) REFERENCES `categories`(`id`)  ;

ALTER TABLE `products` ADD CONSTRAINT `FK_4cedfc01-311c-4e74-b8a0-fd0748f688bf` FOREIGN KEY (`flavor_id`) REFERENCES `flavors`(`id`)  ;






